import React, {Component} from 'react'


class Profil extends Component{
  
    render(){
      return(
        <div>
          <h1>{this.props.coordonee.fullName}</h1>
          <p>{this.props.coordonee.fullName}</p>
          <p></p>
        </div>
      )
      
    }
  }

export default Profil
